import React, { Component } from 'react';

import Head from 'next/head';

class Stats extends Component {

    constructor(props) {
        super(props);
        this.state = {
            stats: '',
            homeInfo: ''
        }
    }

    UNSAFE_componentWillMount() {
        this.setStats();
    }

    setStats = () => {
        this.setState({ stats: this.props.statsObj, homeInfo: this.props.homeInfoObj });
    }

    getStats = () => {
        let data = this.state.stats;
        return (
            <div className="stats-section">
                <div className="container">
                    <div className="head">
                        <span className="title">{data.title}</span>
                        <h2>{data.heading}</h2>
                    </div>
                    <div className="cols">
                        {data.cols.map((items, index) => {
                            return (
                                <div className="col" key={index}>
                                    <div className="img">
                                        <img src={items.image} alt="Image Description" />
                                    </div>
                                    <h3>{items.heading}</h3>
                                    <span>{items.number}</span>
                                    <strong>{items.type}</strong>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </div>
        )
    }

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                {this.getStats()}

                <div className="access-block">
                    <div className="container">
                        <div className="info">
                            <h2>Safely Access Your Information Anytime, Anywhere</h2>
                            <a href="#" className="btn">Schedule Demo</a>
                            <a href="#" className="btn full">Start Free Trial</a>
                        </div>
                        <div className="info-columns">
                            <div className="col">
                                <span className="title"><img src="images/cloud.png" alt="Image description" /> Cloud-Based</span>
                                <p>Our AWS, cloud-based solution means you can use Aesthetic Record from anywhere, no software required</p>
                            </div>
                            <div className="col">
                                <span className="title"><img src="images/shake-hands.png" alt="Image description" /> Reliable</span>
                                <p>With a 99.99% uptime, our system is always available when you need it! We are constantly improving to make things easier</p>
                            </div>
                            <div className="col">
                                <span className="title"><img src="images/leafs.png" alt="Image description" /> Paperless</span>
                                <p>Say goodbye to paper and reduce your risk of damaged, lost or misplace files. You’ll save time and money reducing errors with our technology platform</p>
                            </div>
                            <div className="col">
                                <span className="title"><img src="images/lock.png" alt="Image description" /> Private & Secure</span>
                                <p>We meet all HIPAA and GDPR Laws, and every data transmission is encrypted using SSL protection</p>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}

export default Stats;
